import React, { Component } from 'react'
import {connect} from 'react-redux'

// UI
class Count extends Component {
  render() {
    return (
      <div>
        <h2>当前求和为：{this.props.he}</h2>
      </div>
    )
  }
}

// 容器
export default connect(
    // 映射状态
    state=>({he:state}),

    // 映射操作状态的方法
    {}
)(Count)
